import React from 'react';
import Rating from '../rating/rating';
import classes from './products.module.css';
import {NavLink} from 'react-router-dom';
import Productscreen from '../../Screens/ProductScreen';
import {Route} from 'react-router-dom';

const products=(props)=>{
    let data={};
    data=props.product;
    console.log(data);
    return(
       
                <div>
                      <div>
                      <NavLink>
                      <a href={`/product/${data.id}`}><img src={data.image} alt="" className={classes.product_image}/></a>
                      </NavLink>
                         
                      </div>
                      <div  className={classes.product_title}>
                          <a href={`/product/${data.id}`}><p> {data.name}</p></a>
                      </div>
     
                        <Rating rating={data.rating} numReviews={data.numReviews}/>

                        
                  
                      <div>
                          <p className={classes.product_price}> Rs {data.price}</p>
                      </div>
                      <Route path="/product/:id" render={(props) => (
                            <Productscreen {...props} data={data} />
                        )}/>  
                </div>
                
    )
}

export default products;
